import Papa from 'papaparse';

interface Product {
    name: string;
    brand: string;
    price: string;
    rating: number;
    review: string;
    description: string;
    skintype: string;
    productImageUrl: string;
}

export const getProducts = () : Promise<Product[]> => {
    const data = fetch("https://julie-commerce.s3.us-west-2.amazonaws.com/moisturizer1_clean.csv")
    .then(response => response.text())
    .then(v => Papa.parse(v)) as Promise<String[]>;

    return data.then(products => {
        return products.map(product => {
            const parts = product.split(',');
            return {
                name: parts[0],
                brand: parts[1],
                price: parts[2],
                review: parts[3],
                rating: parts[4],
                description: parts[5],
                skintype: parts[6],
                productImageUrl: parts[7]
            }
        });
    })
}
